  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rainwater
  Basin WMD outlines District accomplishments during the 1987 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses research and
  investigations. Administration is outlined; information about personnel, youth programs,
  funding, and safety is given. Habitat management is also covered; subjects include
  wetlands, forests, croplands, grasslands, grazing, haying, fire management, and
  pest control. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, scientific collections, and disease control. The public uses of the
  WMD described in this report include hunting, trapping, wildlife observation, and
  law enforcement. The equipment and facilities section of the report provides information
  about new construction, equipment replacement, and energy conservation. Cooperative
  programs, refuge brochures, and items of interest are provided at the end.\",\n\t\"owner_org\":
